import React from "react";
import { NavLink } from "react-router-dom";
import NotificationIcon from '@material-ui/icons/Notifications';
import EmailIcon from '@material-ui/icons/Email';
import SearchIcon from '@material-ui/icons/SearchRounded';

export const NavigationBar = () => {
  return (
        <>
        <nav className="navbar navbar-expand-lg navbar-light bg-white ml-5">
          <NavLink className="navbar-brand ml-3" to="#"><SearchIcon /></NavLink>
          <button className="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation" >
            <span className="navbar-toggler-icon"></span>
          </button>

          <div className="collapse navbar-collapse" id="navbarSupportedContent">

            <ul className="navbar-nav ml-auto">
              <li className="nav-item active">
                <NavLink className="nav-link" to="#">+ Add <span class="sr-only">(current)</span></NavLink>
              </li>
              <li className="nav-item">
                <NavLink className="nav-link" to="/email"><EmailIcon /></NavLink>
              </li>
              <li class="nav-item dropdown">
                <NavLink className="nav-link dropdown-toggle" to="#" id="navbarDropdown" role="button" data-toggle="dropdown" aria-haspopup="true" aria-expanded="false">
                  Name
                </NavLink>
                <div className="dropdown-menu" aria-labelledby="navbarDropdown">
                  <NavLink className="dropdown-item" to="#">Action</NavLink>
                  <NavLink className="dropdown-item" to="#">Another action</NavLink>
                </div>
              </li>
              <li className="nav-item">
                <NavLink className="nav-link disabled" to="#" tabindex="-1" aria-disabled="true"><NotificationIcon /></NavLink>
              </li>
            </ul>
          </div>
        </nav>
    </>
  );
};

// export default NavigationBar;
